package basic;

public class Swap_num {

	public static void main(String[] args)
	{
		// TODO Auto-generated method stub
		int a=5;
		int b=9;
		System.out.println("Before swapping a=" + a + "b=" +b);
		int temp=b;
		b=a;
		a=temp;
		System.out.println("After swapping a=" + a + "b=" +b);

		
		

	}

}
